const programmingLanguage = ['Python', 'Javascript', 'C#', 'Java', 'Puby'];

export default function Lang() {
    const   lang = programmingLanguage.map(elem => <li>{elem}</li>);
    return (
        <ul>{lang}</ul>
    )
}
